import React from 'react';

const AjoutAnimaux = () => {
    return (
        <div>
            <h1>Ajout animaux</h1>

            <form className="formulaire" onSubmit={creerPersonnels}>
                <legend>Ajout animaux</legend>
                <input
                    type="text"
                    name="prenom_animaux"
                    className="champsFormulaire"
                    id="prenom_animaux"
                    placeholder="Prénom..."
                    value={nouveauxPersonnels.nom_utilisateur}
                    onChange={inputChangement}
                    required
                />
                <label htmlFor="prenom_animaux"></label>

                <input
                    type="password"
                    name="mot_de_passe"
                    className="champsFormulaire"
                    id="mot_de_passe"
                    placeholder="Mot de passe..."
                    value={nouveauxPersonnels.mot_de_passe}
                    onChange={inputChangement}
                    required
                />


                <label htmlFor="role">Vétérinaire</label>

                <div className="centrer">
                    <button type="submit" className="bouton_zoo">Créer</button>
                    <button className="bouton_zoo" /*onClick={retourAccueil}*/>Annuler</button>
                </div>
            </form>
        </div>
    );
};

export default AjoutAnimaux;
